import React from 'react';
import './App.css';
import { 
  TextField ,
  TextareaAutosize
} from '@material-ui/core';

function App() {
  return (
    <div className="App">
     <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows"></TextareaAutosize>
    </div>
  );
}

export default App;
